0207,1426255896),('6','seshat','all',1,NULL,NULL,NULL,'accept',1425609424,1425609424),('7','seshat','all',1,NULL,NULL,NULL,'accept',1425609724,1425609724),('8','seshat','all',1,'b',NULL,NULL,'accept',1425609778,1425609778),('9','seshat','all',1,'b',NULL,NULL,'accept',1425609826,1425609826),('aaaa','all','all',1,'ontology','{\"http:\\/\\/www.w3.org\\/ns\\/oa#\":{\"_:ewjozgee6a\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Ontology\",\"http:\\/\\/purl.org\\/dc\\/terms\\/modified\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTime\",\"data\":\"2013-02-22T21:40:51+01:00\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#versionInfo\":{\"type\":\"string\",\"data\":\"0.9.20130208\"},\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/title\":{\"lang\":\"en\",\"data\":\"Open Annotation Data Model\"},\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/creator\":[{\"lang\":\"en\",\"data\":\"Robert Sanderson\"},{\"lang\":\"it\",\"data\":\"Paolo Ciccarese\"},{\"lang\":\"vls\",\"data\":\"Herbert Van de Sompel\"}],\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/contributor\":{\"lang\":\"en\",\"data\":\"Stian Soiland-Reyes\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The Open Annotation Core Data Model specifies an interoperable framework for creating associations between related resources, annotations, using a methodology that conforms to the Architecture of the World Wide Web.\\r\\n\\r\\nThis ontology is a non-normative OWL formalization of the textual OA specification at http:\\/\\/www.openannotation.org\\/spec\\/core\\/20130208\\/index.html\\r\\n\\r\\nNote that OWL imports are disabled in the published version in order to reduce external implications, improve OWL 2 Profile conformity and increase interoperability. Some OWL tools might thus misleadingly show this ontology as (re)defining properties like skos:prefLabel.\"},\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/description\":{\"lang\":\"en\",\"data\":\"The Open Annotation Core Data Model specifies an interoperable framework for creating associations between related resources, annotations, using a methodology that conforms to the Architecture of the World Wide Web. Open Annotations can easily be shared between platforms, with sufficient richness of expression to satisfy complex requirements while remaining simple enough to also allow for the most common use cases, such as attaching a piece of text to a single web resource.\\r\\n\\r\\nAn Annotation is considered to be a set of connected resources, typically including a body and target, where the body is somehow about the target. The full model supports additional functionality, enabling semantic annotations, embedding content, selecting segments of resources, choosing the appropriate representation of a resource and providing styling hints for consuming clients.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":\"http:\\/\\/www.openannotation.org\\/spec\\/core\\/20130208\\/index.html\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#versionIRI\":\"http:\\/\\/www.openannotation.org\\/spec\\/core\\/20130208\\/oa.owl\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#annotatedBy\":{\"_:ewjozgeekk\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"annotatedBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The object of the relationship is a resource that identifies the agent responsible for creating the Annotation. This may be either a human or software agent. \\r\\n\\r\\nThere SHOULD be exactly 1 oa:annotatedBy relationship per Annotation, but MAY be 0 or more than 1, as the Annotation may be anonymous, or multiple agents may have worked together on it.\\r\\n\\r\\nIt is RECOMMENDED to use these and other FOAF terms to describe agents: foaf:Person, prov:SoftwareAgent, foaf:Organization, foaf:name, foaf:mbox, foaf:openid, foaf:homepage\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasAttributedTo\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#cachedSource\":{\"_:ewjozgeeve\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"cachedSource\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A link to a copy of the Source resource\'s representation appropriate for the Annotation, typically a copy of the original at the time that the Annotation was created\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#TimeState\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#default\":{\"_:ewjozgef55\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"default\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The constituent resource of a oa:Choice to use as a default option, if there is no other means to determine which would be most appropriate.\\r\\n\\r\\nThere SHOULD be exactly 1 default relationship for each Choice.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Choice\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#item\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#equivalentTo\":{\"_:ewjozgefkz\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"equivalentTo\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The subject and object resources of the oa:equivalentTo relationship represent the same resource, but potentially have different metadata such as oa:serializedBy, oa:serializedAt and serialization format.  oa:equivalentTo is a symmetrical and transitive relationship; if A oa:equivalentTo B, then it is also true that B oa:equivalent A; and that if B oa:equivalentTo C, then it is also true that A oa:equivalentTo C. \\r\\n\\r\\nThe Annotation MAY include 0 or more instances of the oa:equivalentTo relationship between copies of the Annotation or other resources, and SHOULD include as many as are available.\\r\\n\\r\\nIf a system publishes an embedded resource (a cnt:Content) at a new HTTP URI, then it SHOULD express the oa:equivalentTo relationship between the resource\'s URN and the new URI from which it is available.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#alternateOf\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasBody\":{\"_:ewjozgehcm\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasBody\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between oa:Annotation and body. The body is somehow \\\"about\\\" the oa:hasTarget of the annotation.\\r\\n\\r\\nThe Body may be of any media type, and contain any type of content. The Body SHOULD be identified by HTTP URIs unless they are embedded within the Annotation.\\r\\n\\r\\nEmbedded bodies SHOULD be instances of cnt:ContentAsText and embed their content with cnt:chars. They SHOULD declare their media type with dc:format, and MAY indicate their language using dc:language and a RFC-3066 language tag. \\r\\n\\r\\nThere is no OA class provided for \\\"Body\\\" as a body might be a target of a different annotation. However, there SHOULD be 1 or more content-based classes associated with the body resources of an Annotation, and the dctypes: vocabulary is recommended for this purpose, for instance dctypes:Text to declare textual content.\\r\\n\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasScope\":{\"_:ewjozgek0b\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasScope\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a Specific Resource and the resource that provides the scope or context for it in this Annotation.\\r\\n\\r\\nThere MAY be 0 or more hasScope relationships for each Specific Resource.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasSelector\":{\"_:ewjozgelc5\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:SpecificResource and a oa:Selector.\\r\\n\\r\\nThere MUST be exactly 0 or 1 oa:hasSelector relationship associated with a \\r\\nSpecific Resource. \\r\\n\\r\\nIf multiple Selectors are required, either to express a choice between different optional, equivalent selectors, or a chain of selectors that should all be processed, it is necessary to use oa:Choice, oa:Composite or oa:List as a selector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasSource\":{\"_:ewjozgemm1\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasSource\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:SpecificResource and the resource that it is a more specific representation of. \\r\\n\\r\\nThere MUST be exactly 1 oa:hasSource relationship associated with a Specific Resource.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasState\":{\"_:ewjozgenc4\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasState\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:SpecificResource and a oa:State resource.\\r\\n\\r\\nThere MAY be 0 or 1 oa:hasState relationship for each SpecificResource.\\r\\n\\r\\nIf there are multiple State resources that must be associated with the specific resource, then the use of the Multiplicity Constructs oa:Choice, oa:Composite or oa:List is RECOMMENDED.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#State\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasTarget\":{\"_:ewjozgeo87\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasTarget\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between oa:Annotation and target. The target resource is what the oa:hasBody is somewhat \\\"about\\\".\\r\\n\\r\\nThe target may be of any media type, and contain any type of content. The target SHOULD be identified by HTTP URIs unless they are embedded within the Annotation.\\r\\n\\r\\nEmbedded targets SHOULD be instances of cnt:ContentAsText and embed their content with cnt:chars. They SHOULD declare their media type with dc:format, and MAY indicate their language using dc:language and a RFC-3066 language tag. \\r\\n\\r\\nThere is no OA class provided for \\\"Target\\\" as a target might be a body in a different annotation. However, there SHOULD be 1 or more content-based classes associated with the target resources of an Annotation, and the dctypes: vocabulary is recommended for this purpose, for instance dctypes:Text to declare textual content.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#item\":{\"_:ewjozgepds\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"item\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a multiplicity construct node and its constituent resources.\\r\\n\\r\\nThere MUST be 1 or more item relationships for each multiplicity construct oa:Choice, oa:Composite and oa:List.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#member\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#motivatedBy\":{\"_:ewjozgeqrv\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"motivatedBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between an Annotation and a Motivation, indicating the reasons why the Annotation was created.\\r\\n\\r\\nEach Annotation SHOULD have at least one oa:motivatedBy relationship, and MAY be more than 1.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#serializedBy\":{\"_:ewjozgermw\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"serializedBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The object of the relationship is the agent, likely software, responsible for generating the serialization of the Annotation\'s serialization. \\r\\n\\r\\nIt is RECOMMENDED to use these and other FOAF terms to describe agents: foaf:Person, prov:SoftwareAgent, foaf:Organization, foaf:name, foaf:mbox, foaf:openid, foaf:homepage\\r\\n\\r\\nThere MAY be 0 or more oa:serializedBy relationships per Annotation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasAttributedTo\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#styledBy\":{\"_:ewjozgesgu\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"styledBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:Annotation and a oa:Style.\\r\\n\\r\\nThere MAY be 0 or 1 styledBy relationships for each Annotation.\\r\\n\\r\\nIf there are multiple Style resources that must be associated with the Annotation, then the use of the Multiplicity Constructs oa:Choice, oa:Composite or oa:List is RECOMMENDED.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Style\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#annotatedAt\":{\"_:ewjozgetki\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"annotatedAt\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The time at which the Annotation was created. \\r\\n\\r\\nThere SHOULD be exactly 1 oa:annotatedAt property per Annotation, and MUST NOT be more than 1. The datetime MUST be expressed in the xsd:dateTime format, and SHOULD have a timezone specified.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTimeStamp\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#end\":{\"_:ewjozgeukz\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"end\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The end position of the segment of text or bytes. The first character\\/byte in the full text\\/stream is position 0. The character\\/byte indicated at position oa:end is NOT included within the selected segment. \\r\\n\\r\\nSee oa:DataPositionSelector and oa:oa:TextPositionSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#nonNegativeInteger\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#exact\":{\"_:ewjozgevjk\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"exact\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A copy of the text which is being selected, after normalization.\\r\\n\\r\\nSee oa:TextQuoteSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#prefix\":{\"_:ewjozgeweg\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"prefix\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A snippet of text that occurs immediately before the text which is being selected.\\r\\n\\r\\nSee oa:TextQuoteSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#serializedAt\":{\"_:ewjozgex9g\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"serializedAt\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The time at which the agent referenced by oa:serializedBy generated the first serialization of the Annotation, and any subsequent substantially different one. The annotation graph MUST have changed for this property to be updated, and as such represents the last modified datestamp for the Annotation. This might be used to determine if it should be re-imported into a triplestore when discovered. \\r\\n\\r\\nThere MAY be exactly 1 oa:serializedAt property per Annotation, and MUST NOT be more than 1. The datetime MUST be expressed in the xsd:dateTime format, and SHOULD have a timezone specified.\\r\\n\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTimeStamp\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#start\":{\"_:ewjozgey59\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"start\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The starting position of the segment of text or bytes. The first character\\/byte in the full text\\/stream is position 0. The character\\/byte indicated at position oa:start is included within the selected segment. \\r\\n\\r\\nSee oa:DataPositionSelector and oa:TextPositionSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#nonNegativeInteger\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#styleClass\":{\"_:ewjozgez3d\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"styleClass\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The string name of the class used in the CSS description that should be applied to the Specific Resource.\\r\\n\\r\\nThere MAY be 0 or more styleClass properties on a Specific Resource.\\r\\n\\r\\nSee oa:CssStyle.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#suffix\":{\"_:ewjozgf00y\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"suffix\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The snippet of text that occurs immediately after the text which is being selected. \\r\\n\\r\\nSee oa:TextQuoteSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#when\":{\"_:ewjozgf1fs\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"when\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The timestamp at which the Source resource should be interpreted for the Annotation, typically the time that the Annotation was created.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTimeStamp\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#TimeState\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\":{\"_:ewjozgf2u4\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Annotation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"Typically an Annotation has a single Body (oa:hasBody), which is the comment or other descriptive resource, and a single Target (oa:hasTarget) that the Body is somehow \\\"about\\\". The Body provides the information which is annotating the Target. \\r\\n\\r\\nThis \\\"aboutness\\\" may be further clarified or extended to notions such as classifying or identifying with oa:motivatedBy.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#Choice\":{\"_:ewjozgf5cg\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Choice\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#Alt\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A multiplicity construct that conveys to a consuming application that it should select one of the constituent resources to display to the user, and not render\\/use all of them. \\r\\n\\r\\noa:Choice can be used as the object of the object of the oa:hasBody, oa:hasTarget, oa:hasSelector, oa:hasState, oa:styledBy and oa:hasScope relationships, \\r\\n\\r\\nThere MUST be 1 or more oa:item relationships for each oa:Choice.\\r\\n\\r\\nThere SHOULD be exactly 1 default relationship for each Choice.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#Composite\":{\"_:ewjozgf6rc\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Composite\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#Bag\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A multiplicity construct that conveys to a consuming application that all of the constituent resources are required for the Annotation to be correctly interpreted. \\r\\n\\r\\noa:Composite can be used as the object of the object of the oa:hasBody, oa:hasTarget, oa:hasSelector, oa:hasState, oa:styledBy and oa:hasScope relationships, \\r\\n\\r\\nThere MUST be 2 or more oa:item relationships for each oa:Composite.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#CssStyle\":{\"_:ewjozgf85r\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"CssStyle\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Style\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes styles for resources participating in the Annotation using CSS.\\r\\n\\r\\nSpecific Resources MAY be assigned a CSS style class using oa:styleClass.\\r\\n\\r\\nThe CSS resource MAY have its own dereferencable URI that provides the information. For example, \\\"Style1\\\" in the diagram below might actually have the URI \\\"http:\\/\\/www.example.com\\/styles\\/annotations.css\\\". It MAY be embedded within the Annotation using the inline constructions described in Embedding Resources.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#DataPositionSelector\":{\"_:ewjozgf9fv\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"DataPositionSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector which describes a range of data based on its start and end positions within the byte stream of the representation.\\r\\n\\r\\nEach DataPositionSelector MUST have exactly 1 oa:start property.\\r\\n\\r\\nEach TextPositionSelector MUST have exactly 1 oa:end property.\\r\\n\\r\\nSee oa:TextPositionSelector for selection at normalized character level rather than bytestream level.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#FragmentSelector\":{\"_:ewjozgfapm\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"FragmentSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector which describes the segment of interest in a representation, through the use of the fragment identifier component of a URI.\\r\\n\\r\\nIt is RECOMMENDED to use oa:FragmentSelector as the selector on a Specific Resource rather than annotating the fragment URI directly, in order to improve discoverability of annotation on the Source.\\r\\n\\r\\nThe oa:FragmentSelector MUST have exactly 1 rdf:value property, containing the fragment identifier component of a URI that describes the segment of interest in the resource, excluding the initial \\\"#\\\".\\r\\n\\r\\nThe Fragment Selector SHOULD have a dcterms:conformsTo relationship with the object being the specification that defines the syntax of the fragment, for instance <http:\\/\\/tools.ietf.org\\/rfc\\/rfc3236> for HTML fragments. \"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#HttpRequestState\":{\"_:ewjozgfbyl\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"HttpRequestState\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#State\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes how to retrieve an appropriate representation of the Source resource for the Annotation, based on the HTTP Request headers to send to the server.\\r\\n\\r\\nThere MUST be exactly 1 rdf:value property per HttpRequestState, containing HTTP request headers as a single, complete string, exactly as they would appear in an HTTP request. \"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#List\":{\"_:ewjozgfd78\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"List\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Composite\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A multiplicity construct that conveys to a consuming application that all of the constituent resources are required for the Annotation to be correctly interpreted, and in a particular order. \\r\\n\\r\\noa:List can be used as the object of the object of the oa:hasBody, oa:hasTarget, oa:hasSelector, oa:hasState, oa:styledBy and oa:hasScope relationships, \\r\\n\\r\\nThere MUST be 2 or more oa:item relationships for each oa:List, with their order defined using the rdf:List construct of rdf:first\\/rdf:rest\\/rdf:nil.\\r\\n\\r\\nAll the elements of the list should also be declared using oa:item, and each of the oa:items should appear at least once in the list.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\":{\"_:ewjozgff1s\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Motivation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#Concept\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The Motivation for creating an Annotation, indicated with oa:motivatedBy, is a reason for its creation, and might include things like oa:replying to another annotation, oa:commenting on a resource, or oa:linking to a related resource.\\r\\n\\r\\nEach Annotation SHOULD have at least one oa:motivatedBy relationship to an instance of oa:Motivation, which is a subClass of skos:Concept.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\":{\"_:ewjozgfh2j\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Selector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes the segment of interest in a representation of a Source resource, indicated with oa:hasSelector from the Specific Resource. \\r\\n\\r\\nThis class is not used directly in Annotations, only its subclasses are.\\r\\n\\r\\nThe nature of the Selector will be dependent on the type of the representation for which the segment is conveyed. The specific type of selector should be indicated using a subclass of oa:Selector.\\r\\n\\r\\nThe Specifier\'s description MAY be conveyed as an external or embedded resource (cnt:Content), or as RDF properties within the graph. The description SHOULD use existing standards whenever possible. If the Specifier has an HTTP URI, then its description, and only its description, MUST be returned when the URI is dereferenced.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#SemanticTag\":{\"_:ewjozgfkfy\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"SemanticTag\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Tag\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A class assigned to the Body when it is a semantic tagging resource; a URI that identifies a concept, rather than an embedded string, frequently a term from a controlled vocabulary.\\r\\n\\r\\nIt is NOT RECOMMENDED to use the URI of a document as a Semantic Tag, as it might also be used as a regular Body in other Annotations which would inherit the oa:SemanticTag class assignment. Instead it is more appropriate to create a new URI and link it to the document, using the foaf:page predicate.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\":{\"_:ewjozgfm8o\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"SpecificResource\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource identifies part of another Source resource, a particular representation of a resource, a resource with styling hints for renders, or any combination of these. \\r\\n\\r\\nThe Specific Resource takes the role of oa:hasBody or oa:hasTarget in an oa:Annotation instead of the Source resource.\\r\\n\\r\\nThere MUST be exactly 1 oa:hasSource relationship associated with a Specific Resource.\\r\\n\\r\\nThere MUST be exactly 0 or 1 oa:hasSelector relationship associated with a Specific Resource.\\r\\n\\r\\nThere MAY be 0 or 1 oa:hasState relationship for each Specific Resource.\\r\\n\\r\\nIf the Specific Resource has an HTTP URI, then the exact segment of the Source resource that it identifies, and only the segment, MUST be returned when the URI is dereferenced. For example, if the segment of interest is a region of an image and the Specific Resource has an HTTP URI, then dereferencing it MUST return the selected region of the image as it was at the time when the annotation was created. Typically this would be a burden to support, and thus the Specific Resource SHOULD be identified by a globally unique URI, such as a UUID URN. If it is not considered important to allow other Annotations or systems to refer to the Specific Resource, then a blank node MAY be used instead.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#State\":{\"_:ewjozgfo0m\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"State\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes how to retrieve an appropriate representation of the Source resource, indicated with oa:hasState from the Specific Resource.\\r\\n\\r\\nThis class is not used directly in Annotations, only its subclasses are.\\r\\n\\r\\nThe Specifier\'s description MAY be conveyed as an external or embedded resource (cnt:Content), or as RDF properties within the graph. The description SHOULD use existing standards whenever possible. If the Specifier has an HTTP URI, then its description, and only its description, MUST be returned when the URI is dereferenced.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#Style\":{\"_:ewjozgfpy6\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Style\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes the style in which the selection or resource should be rendered, indicated with oa:styledBy from an oa:Annotation.\\r\\n\\r\\nThis class is not used directly in Annotations, only its subclasses are.\\r\\n\\r\\nThe content of the resource provides the rendering hints about the Annotation\'s constituent resources. \\r\\n\\r\\nThe Specifier\'s description MAY be conveyed as an external or embedded resource (cnt:Content), or as RDF properties within the graph. The description SHOULD use existing standards whenever possible. If the Specifier has an HTTP URI, then its description, and only its description, MUST be returned when the URI is dereferenced.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#SvgSelector\":{\"_:ewjozgftc6\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"SvgSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector which selects an area specified as an SVG shape.\\r\\n\\r\\nThe SVG document should either be retrievable by resolving the URI of this resource, or be included as an Embedded Resource using cnt:Content.\\r\\n\\r\\nIt is RECOMMENDED that the document contain only a single shape element and that element SHOULD be one of: path, rect, circle, ellipse, polyline, polygon or g. The g element SHOULD ONLY be used to construct a multi-element group, for example to define a donut shape requiring an outer circle and a clipped inner circle.\\r\\n\\r\\nThe dimensions of both the shape and the SVG canvas MUST be relative to the dimensions of the Source resource. For example, given an image which is 600 pixels by 400 pixels, and the desired section is a circle of 100 pixel radius at the center of the image, then the SVG element would be: <circle cx=\\\"300\\\" cy=\\\"200\\\" r=\\\"100\\\"\\/>\\r\\n\\r\\nIt is NOT RECOMMENDED to include style information within the SVG element, nor Javascript, animation, text or other non shape oriented information. Clients SHOULD ignore such information if present.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#Tag\":{\"_:ewjozgfw05\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Tag\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A class assigned to the Body when it is a tag, such as a embedded text string with cnt:chars.\\r\\n\\r\\nTags are typically keywords or labels, and used for organization, description or discovery of the resource being tagged. In the Semantic Web, URIs are used instead of strings to avoid the issue of polysemy where one word has multiple meanings, such usage MUST be indicated using the subclass oa:SemanticTag.\\r\\n\\r\\nAnnotations that tag resources, either with text or semantic tags, SHOULD also have the oa:tagging motivation to make the reason for the Annotation more clear to applications, and MAY have other motivations as well.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#TextPositionSelector\":{\"_:ewjozgfxr0\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"TextPositionSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An oa:Selector which describes a range of text based on its start and end positions.\\r\\n\\r\\nThe text MUST be normalized before counting characters. For a Selector that works from the bitstream rather than the rendered characters, see oa:DataPositionSelector.\\r\\n\\r\\nEach oa:TextPositionSelector MUST have exactly 1 oa:start property.\\r\\n\\r\\nEach oa:TextPositionSelector MUST have exactly 1 oa:end property.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#TextQuoteSelector\":{\"_:ewjozgfzez\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"TextQuoteSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector that describes a textual segment by means of quoting it, plus passages before or after it.\\r\\n\\r\\nFor example, if the document were \\\"abcdefghijklmnopqrstuvwxyz\\\", one could select \\\"efg\\\" by a oa:prefix of \\\"abcd\\\", the quotation of oa:exact \\\"efg\\\" and a oa:suffix of \\\"hijk\\\".\\r\\n\\r\\nThe text MUST be normalized before recording.\\r\\n\\r\\nEach TextQuoteSelector MUST have exactly 1 oa:exact property.\\r\\n\\r\\nEach TextQuoteSelector SHOULD have exactly 1 oa:prefix property, and MUST NOT have more than 1.\\r\\n\\r\\nEach TextQuoteSelector SHOULD have exactly 1 oa:suffix property, and MUST NOT have more than 1.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#TimeState\":{\"_:ewjozgg121\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"TimeState\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#State\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes how to retrieve a representation of the Source resource that is temporally appropriate for the Annotation.\\r\\n\\r\\nThere MUST be at least one of oa:cachedSource or oa:when specified. If there is more than 1, each gives an alternative copy of the representation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#bookmarking\":{\"_:ewjozgg2vi\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents the creation of a bookmark to the target resources or recorded point or points within one or more resources. For example, an Annotation that bookmarks the point in a text where the reader finished reading. Bookmark Annotations may or may not have a Body resource.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"bookmarking\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#classifying\":{\"_:ewjozgg67t\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents the assignment of a classification type, typically from a controlled vocabulary, to the target resource(s). For example to classify an Image resource as a Portrait.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"classifying\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#commenting\":{\"_:ewjozgga29\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a commentary about or review of the target resource(s). For example to provide a commentary about a particular PDF.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"commenting\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#describing\":{\"_:ewjozggg8a\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a description of the target resource(s), as opposed to a comment about them. For example describing the above PDF\'s contents, rather than commenting on their accuracy.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"describing\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#editing\":{\"_:ewjozggl0j\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a request for a modification or edit to the target resource. For example, an Annotation that requests a typo to be corrected.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"editing\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#highlighting\":{\"_:ewjozggo3s\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a highlighted section of the target resource or segment. For example to draw attention to the selected text that the annotator disagrees with. A Highlight may or may not have a Body resource\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"highlighting\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#identifying\":{\"_:ewjozggq7n\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents the assignment of an identity to the target resource(s). For example, annotating the name of a city in a string of text with the URI that identifies it.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"identifying\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#linking\":{\"_:ewjozggsaj\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents an untyped link to a resource related to the target.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"linking\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#moderating\":{\"_:ewjozggx81\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents an assignment of value or quality to the target resource(s). For example annotating an Annotation to moderate it up in a trust network or threaded discussion.\"},\"http: