\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A reference to the principal section of the PROV-CONSTRAINTS document that describes this concept.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"\"}},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#versionInfo\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#specializationOf\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"specializationOf\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-specialization\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-specialization\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"alternate\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#inverse\":{\"type\":\"string\",\"data\":\"generalizatio