\'extended\'. This classification is used by the prov-o html document to gently introduce prov-o terms to its users. \"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#order\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The position that this OWL term should be listed within documentation. The scope of the documentation (e.g., among all terms, among terms within a prov:category, among properties applying to a particular class, etc.) is unspecified.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#editorsDefinition\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"When the prov-o term does not have a definition drawn from prov-dm, and the prov-o editor provides one.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"Classify prov-o terms into six components according to prov-dm, including \'agents-responsibility\', \'alternate\', \'annotations\', \'collections\', \'derivations\', and \'entities-activities\'. This classification is used so that readers of prov-o specification can find its correspondence with the prov-dm specification.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#qualifiedForm\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"This annotation property links a subproperty of prov:wasInfluencedBy with the subclass of prov:Influence and the qualifying property that are used to qualify it. \\n\\nExample annotation:\\n\\n    prov:wasGeneratedBy prov:qualifiedForm prov:qualifiedGeneration, prov:Generation .\\n\\nThen this unqualified assertion:\\n\\n    :entity1 prov:wasGeneratedBy :activity1 .\\n\\ncan be qualified by adding:\\n\\n   :entity1 prov:qualifiedGeneration :entity1Gen .\\n   :entity1Gen \\n       a prov:Generation, prov:Influence;\\n       prov:activity :activity1;\\n       :customValue 1337 .\\n\\nNote how the value of the unqualified influence (prov:wasGeneratedBy :activity1) is mirrored as the value of the prov:activity (or prov:entity, or prov:agent) property on the influence class.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#todo\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#AnnotationProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\"