\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#ActivityInfluence\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"ActivityInfluence\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":[\"http:\\/\\/www.w3.org\\/ns\\/prov#Influence\",\"_:genid52\"],\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#disjointWith\":\"http:\\/\\/www.w3.org\\/ns\\/prov#EntityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#editorsDefinition\":{\"lang\":\"en\",\"data\":\"ActivitiyInfluence is the capacity of an activity to have an effect on the character, development, or behavior of another by means of generation, invalidation, communication, or other.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":[{\"lang\":\"en\",\"data\":\"ActivityInfluence provides additional descriptions of an Activity\'s binary influence upon any other kind of resource. Instances of ActivityInfluence use the prov:activity property to cite the influencing Activity.\"},{\"lang\":\"en\",\"data\":\"It is not recommended that the type ActivityInfluence be asserted without also asserting one of its more specific subclasses.\"}],\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":\"http:\\/\\/www.w3.org\\/ns\\/prov#activity\"},\"_:genid52\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Restriction\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#onProperty\":\"http:\\/\\/www.w3.org\\/ns\\/prov#hadActivity\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#maxCardinality\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#nonNegativeInteger\",\"data\":\"0\"}},\"http:\\/\\/www.w3.org\\/ns\\/prov#Agent\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Agent\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#disjointWith\":\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-agent\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Agent\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"An agent is something that bears some form of responsibility for an activity taking place, for the existence of an entity, or for another agent\'s activity. \"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"starting-point\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#AgentInfluence\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"AgentInfluence\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Influence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#editorsDefinition\":{\"lang\":\"en\",\"data\":\"AgentInfluence is the capacity of an agent to have an effect on the character, development, or behavior of another by means of attribution, association, delegation, or other.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":[{\"lang\":\"en\",\"data\":\"AgentInfluence provides additional descriptions of an Agent\'s binary influence upon any other kind of resource. Instances of AgentInfluence use the prov:agent property to cite the influencing Agent.\"},{\"lang\":\"en\",\"data\":\"It is not recommended that the type AgentInfluence be asserted without also asserting one of its more specific subclasses.\"}],\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":\"http:\\/\\/www.w3.org\\/ns\\/prov#agent\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Association\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Association\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#AgentInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Association\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Association\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Association provides additional descriptions about the binary prov:wasAssociatedWith relation from an prov:Activity to some prov:Agent that had some responsiblity for it. For example, :baking prov:wasAssociatedWith :baker; prov:qualifiedAssociation [ a prov:Association; prov:agent :baker; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"An activity association is an assignment of responsibility to an agent for an activity, indicating that the agent had a role in the activity. It further allows for a plan to be specified, which is the plan intended by the agent to achieve some goals in the context of this activity.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasAssociatedWith\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Attribution\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Attribution\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#AgentInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-attribution\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-attribution\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Attribution provides additional descriptions about the binary prov:wasAttributedTo relation from an prov:Entity to some prov:Agent that had some responsible for it. For example, :cake prov:wasAttributedTo :baker; prov:qualifiedAttribution [ a prov:Attribution; prov:entity :baker; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"Attribution is the ascribing of an entity to an agent.\\n\\nWhen an entity e is attributed to agent ag, entity e was generated by some unspecified activity that in turn was associated to agent ag. Thus, this relation is useful when the activity is not known, or irrelevant.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasAttributedTo\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Bundle\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Bundle\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Entity\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-bundle-entity\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-bundle-declaration\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"expanded\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A bundle is a named set of provenance descriptions, and is itself an Entity, so allowing provenance of provenance to be expressed.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"Note that there are kinds of bundles (e.g. handwritten letters, audio recordings, etc.) that are not expressed in PROV-O, but can be still be described by PROV-O.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Collection\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Collection\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Entity\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-collection\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"collections\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"expanded\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A collection is an entity that provides a structure to some constituents, which are themselves entities. These constituents are said to be member of the collections.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Communication\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Communication\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#ActivityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Communication\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-wasInformedBy\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Communication provides additional descriptions about the binary prov:wasInformedBy relation from an informed prov:Activity to the prov:Activity that informed it. For example, :you_jumping_off_bridge prov:wasInformedBy :everyone_else_jumping_off_bridge; prov:qualifiedCommunication [ a prov:Communication; prov:activity :everyone_else_jumping_off_bridge; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"type\":\"string\",\"data\":\"Communication is the exchange of an entity by two activities, one activity using the entity generated by the other.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasInformedBy\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Delegation\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Delegation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#AgentInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-delegation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-delegation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Delegation provides additional descriptions about the binary prov:actedOnBehalfOf relation from a performing prov:Agent to some prov:Agent for whom it was performed. For example, :mixing prov:wasAssociatedWith :toddler . :toddler prov:actedOnBehalfOf :mother; prov:qualifiedDelegation [ a prov:Delegation; prov:entity :mother; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"Delegation is the assignment of authority and responsibility to an agent (by itself or by another agent) to carry out a specific activity as a delegate or representative, while the agent it acts on behalf of retains some responsibility for the outcome of the delegated work.\\n\\nFor example, a student acted on behalf of his supervisor, who acted on behalf of the department chair, who acted on behalf of the university; all those agents are responsible in some way for the activity that took place but we do not say explicitly who bears responsibility and to what degree.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#actedOnBehalfOf\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Derivation\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Derivation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#EntityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Derivation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#Derivation-Relation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A derivation is a transformation of an entity into another, an update of an entity resulting in a new one, or the construction of a new entity based on a pre-existing entity.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"derivations\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":[{\"lang\":\"en\",\"data\":\"An instance of prov:Derivation provides additional descriptions about the binary prov:wasDerivedFrom relation from some derived prov:Entity to another prov:Entity from which it was derived. For example, :chewed_bubble_gum prov:wasDerivedFrom :unwrapped_bubble_gum; prov:qualifiedDerivation [ a prov:Derivation; prov:entity :unwrapped_bubble_gum; :foo :bar ].\"},{\"lang\":\"en\",\"data\":\"The more specific forms of prov:Derivation (i.e., prov:Revision, prov:Quotation, prov:PrimarySource) should be asserted if they apply.\"}],\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasDerivedFrom\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#EmptyCollection\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"EmptyCollection\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Collection\",\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"expanded\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"collections\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"An empty collection is a collection without members.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#End\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"End\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":[\"http:\\/\\/www.w3.org\\/ns\\/prov#EntityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\"],\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-End\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-End\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:End provides additional descriptions about the binary prov:wasEndedBy relation from some ended prov:Activity to an prov:Entity that ended it. For example, :ball_game prov:wasEndedBy :buzzer; prov:qualifiedEnd [ a prov:End; prov:entity :buzzer; :foo :bar; prov:atTime \'2012-03-09T08:05:08-05:00\'^^xsd:dateTime ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"End is when an activity is deemed to have been ended by an entity, known as trigger. The activity no longer exists after its end. Any usage, generation, or invalidation involving an activity precedes the activity\'s end. An end may refer to a trigger entity that terminated the activity, or to an activity, known as ender that generated the trigger.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasEndedBy\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Entity\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Entity\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#disjointWith\":\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\",\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-entity\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Entity\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"An entity is a physical, digital, conceptual, or other kind of thing with some fixed aspects; entities may be real or imaginary. \"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"starting-point\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#EntityInfluence\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"EntityInfluence\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Influence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#editorsDefinition\":{\"lang\":\"en\",\"data\":\"EntityInfluence is the capacity of an entity to have an effect on the character, development, or behavior of another by means of usage, start, end, derivation, or other. \"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":[{\"lang\":\"en\",\"data\":\"EntityInfluence provides additional descriptions of an Entity\'s binary influence upon any other kind of resource. Instances of EntityInfluence use the prov:entity property to cite the influencing Entity.\"},{\"lang\":\"en\",\"data\":\"It is not recommended that the type EntityInfluence be asserted without also asserting one of its more specific subclasses.\"}],\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":\"http:\\/\\/www.w3.org\\/ns\\/prov#entity\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Generation\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Generation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":[\"http:\\/\\/www.w3.org\\/ns\\/prov#ActivityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\"],\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Generation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Generation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Generation provides additional descriptions about the binary prov:wasGeneratedBy relation from a generated prov:Entity to the prov:Activity that generated it. For example, :cake prov:wasGeneratedBy :baking; prov:qualifiedGeneration [ a prov:Generation; prov:activity :baking; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"Generation is the completion of production of a new entity by an activity. This entity did not exist before generation and becomes available for usage after this generation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasGeneratedBy\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Influence\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Influence\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-influence\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-influence\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"derivations\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":[{\"lang\":\"en\",\"data\":\"An instance of prov:Influence provides additional descriptions about the binary prov:wasInfluencedBy relation from some influenced Activity, Entity, or Agent to the influencing Activity, Entity, or Agent. For example, :stomach_ache prov:wasInfluencedBy :spoon; prov:qualifiedInfluence [ a prov:Influence; prov:entity :spoon; :foo :bar ] . Because prov:Influence is a broad relation, the more specific relations (Communication, Delegation, End, etc.) should be used when applicable.\"},{\"lang\":\"en\",\"data\":\"Because prov:Influence is a broad relation, its most specific subclasses (e.g. prov:Communication, prov:Delegation, prov:End, prov:Revision, etc.) should be used when applicable.\"}],\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"Influence is the capacity of an entity, activity, or agent to have an effect on the character, development, or behavior of another by means of usage, start, end, generation, invalidation, communication, derivation, attribution, association, or delegation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasInfluencedBy\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"InstantaneousEvent\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#dfn-event\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instantaneous event, or event for short, happens in the world and marks a change in the world, in its activities and in its entities. The term \'event\' is commonly used in process algebra with a similar meaning. Events represent communications or interactions; they are assumed to be atomic and instantaneous.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"The PROV data model is implicitly based on a notion of instantaneous events (or just events), that mark transitions in the world. Events include generation, usage, or invalidation of entities, as well as starting or ending of activities. This notion of event is not first-class in the data model, but it is useful for explaining its other concepts and its semantics.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Invalidation\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Invalidation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":[\"http:\\/\\/www.w3.org\\/ns\\/prov#ActivityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\"],\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Invalidation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Invalidation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"type\":\"string\",\"data\":\"Invalidation is the start of the destruction, cessation, or expiry of an existing entity by an activity. The entity is no longer available for use (or further invalidation) after invalidation. Any generation or usage of an entity precedes its invalidation.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Invalidation provides additional descriptions about the binary prov:wasInvalidatedBy relation from an invalidated prov:Entity to the prov:Activity that invalidated it. For example, :uncracked_egg prov:wasInvalidatedBy :baking; prov:qualifiedInvalidation [ a prov:Invalidation; prov:activity :baking; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasInvalidatedBy\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Location\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Location\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-attribute-location\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-attribute\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A location can be an identifiable geographic place (ISO 19112), but it can also be a non-geographic place such as a directory, row, or column. As such, there are numerous ways in which location can be expressed, such as by a coordinate, address, landmark, and so forth.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"expanded\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":\"http:\\/\\/www.w3.org\\/ns\\/prov#atLocation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Organization\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Organization\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Agent\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-agent\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-types\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"type\":\"string\",\"data\":\"An organization is a social or legal institution such as a company, society, etc.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"expanded\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Person\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Person\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Agent\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-agent\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-types\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"expanded\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"Person agents are people.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Plan\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Plan\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Entity\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Association\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Association\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"type\":\"string\",\"data\":\"A plan is an entity that represents a set of actions or steps intended by one or more agents to achieve some goals.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":[{\"type\":\"string\",\"data\":\"expanded\"},{\"type\":\"string\",\"data\":\"qualified\"}],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"There exist no prescriptive requirement on the nature of plans, their representation, the actions or steps they consist of, or their intended goals. Since plans may evolve over time, it may become necessary to track their provenance, so plans themselves are entities. Representing the plan explicitly in the provenance can be useful for various tasks: for example, to validate the execution as represented in the provenance record, to manage expectation failures, or to provide explanations.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#PrimarySource\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"PrimarySource\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Derivation\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-primary-source\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-original-source\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"derivations\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A primary source for a topic refers to something produced by some agent with direct experience and knowledge about the topic, at the time of the topic\'s study, without benefit from hindsight.\\n\\nBecause of the directness of primary sources, they \'speak for themselves\' in ways that cannot be captured through the filter of secondary sources. As such, it is important for secondary sources to reference those primary sources from which they were derived, so that their reliability can be investigated.\\n\\nA primary source relation is a particular case of derivation of secondary materials from their primary sources. It is recognized that the determination of primary sources can be up to interpretation, and should be done according to conventions accepted within the application\'s domain.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:PrimarySource provides additional descriptions about the binary prov:hadPrimarySource relation from some secondary prov:Entity to an earlier, primary prov:Entity. For example, :blog prov:hadPrimarySource :newsArticle; prov:qualifiedPrimarySource [ a prov:PrimarySource; prov:entity :newsArticle; :foo :bar ] .\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#hadPrimarySource\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Quotation\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Quotation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Derivation\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-quotation\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-quotation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Quotation provides additional descriptions about the binary prov:wasQuotedFrom relation from some taken prov:Entity from an earlier, larger prov:Entity. For example, :here_is_looking_at_you_kid prov:wasQuotedFrom :casablanca_script; prov:qualifiedQuotation [ a prov:Quotation; prov:entity :casablanca_script; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"derivations\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A quotation is the repeat of (some or all of) an entity, such as text or image, by someone who may or may not be its original author. Quotation is a particular case of derivation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasQuotedFrom\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Revision\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Revision\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Derivation\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-revision\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Revision\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"derivations\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A revision is a derivation for which the resulting entity is a revised version of some original. The implication here is that the resulting entity contains substantial content from the original. Revision is a particular case of derivation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Revision provides additional descriptions about the binary prov:wasRevisionOf relation from some newer prov:Entity to an earlier prov:Entity. For example, :draft_2 prov:wasRevisionOf :draft_1; prov:qualifiedRevision [ a prov:Revision; prov:entity :draft_1; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasRevisionOf\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Role\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Role\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-attribute-role\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-attribute\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A role is the function of an entity or agent with respect to an activity, in the context of a usage, generation, invalidation, association, start, and end.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":\"http:\\/\\/www.w3.org\\/ns\\/prov#hadRole\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#SoftwareAgent\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"SoftwareAgent\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Agent\",\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-agent\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-types\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"agents-responsibility\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"A software agent is running software.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"expanded\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Start\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Start\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":[\"http:\\/\\/www.w3.org\\/ns\\/prov#EntityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\"],\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Start\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Start\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Start provides additional descriptions about the binary prov:wasStartedBy relation from some started prov:Activity to an prov:Entity that started it. For example, :foot_race prov:wasStartedBy :bang; prov:qualifiedStart [ a prov:Start; prov:entity :bang; :foo :bar; prov:atTime \'2012-03-09T08:05:08-05:00\'^^xsd:dateTime ] .\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"Start is when an activity is deemed to have been started by an entity, known as trigger. The activity did not exist before its start. Any usage, generation, or invalidation involving an activity follows the activity\'s start. A start may refer to a trigger entity that set off the activity, or to an activity, known as starter, that generated the trigger.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasStartedBy\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#Usage\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Usage\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":[\"http:\\/\\/www.w3.org\\/ns\\/prov#EntityInfluence\",\"http:\\/\\/www.w3.org\\/ns\\/prov#InstantaneousEvent\"],\"http:\\/\\/www.w3.org\\/ns\\/prov#constraints\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#prov-dm-constraints-fig\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-Usage\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#n\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#anyURI\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-n-20130430\\/#expression-Usage\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An instance of prov:Usage provides additional descriptions about the binary prov:used relation from some prov:Activity to an prov:Entity that it used. For example, :keynote prov:used :podium; prov:qualifiedUsage [ a prov:Usage; prov:entity :podium; :foo :bar ].\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"lang\":\"en\",\"data\":\"Usage is the beginning of utilizing an entity by an activity. Before usage, the activity had not begun to utilize this entity and could not have been affected by the entity.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#category\":{\"type\":\"string\",\"data\":\"qualified\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#component\":{\"type\":\"string\",\"data\":\"entities-activities\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/prov-o#\",\"http:\\/\\/www.w3.org\\/ns\\/prov#unqualifiedForm\":\"http:\\/\\/www.w3.org\\/ns\\/prov#used\"},\"_:genid53\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A collection is an entity that provides a structure to some constituents, which are themselves entities. These constituents are said to be member of the collections.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"string\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-collection\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Entity\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#hadMember\"},\"_:genid54\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"type\":\"string\",\"data\":\"hadPrimarySource property is a particular case of wasDerivedFrom (see http:\\/\\/www.w3.org\\/TR\\/prov-dm\\/#term-original-source) that aims to give credit to the source that originated some information.\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#hadPrimarySource\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasDerivedFrom\"},\"_:genid55\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"type\":\"string\",\"data\":\"Attribution is a particular case of trace (see http:\\/\\/www.w3.org\\/TR\\/prov-dm\\/#concept-trace), in the sense that it links an entity to the agent that ascribed it.\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"type\":\"string\",\"data\":\"IF wasAttributedTo(e2,ag1,aAttr) holds, THEN wasInfluencedBy(e2,ag1) also holds. \"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasAttributedTo\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasInfluencedBy\"},\"_:genid56\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"type\":\"string\",\"data\":\"Derivation is a particular case of trace (see http:\\/\\/www.w3.org\\/TR\\/prov-dm\\/#term-trace), since it links an entity to another entity that contributed to its existence.\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasDerivedFrom\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasInfluencedBy\"},\"_:genid57\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"type\":\"string\",\"data\":\"influencer: an identifier (o1) for an ancestor entity, activity, or agent that the former depends on;\"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"string\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-influence\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasInfluencedBy\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"_:genid58\"},\"_:genid58\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#unionOf\":\"_:genid59\"},\"_:genid59\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#first\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Activity\",\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#rest\":\"_:genid60\"},\"_:genid60\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#first\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Agent\",\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#rest\":\"_:genid61\"},\"_:genid61\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#first\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Entity\",\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#rest\":\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#nil\"},\"_:genid62\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/ns\\/prov#definition\":{\"type\":\"string\",\"data\":\"influencee: an identifier (o2) for an entity, activity, or agent; \"},\"http:\\/\\/www.w3.org\\/ns\\/prov#dm\":{\"type\":\"string\",\"data\":\"http:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-dm-20130430\\/#term-influence\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasInfluencedBy\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"_:genid63\"},\"_:genid63\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#unionOf\":\"_:genid64\"},\"_:genid64\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#first\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Activity\",\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#rest\":\"_:genid65\"},\"_:genid65\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#first\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Agent\",\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#rest\":\"_:genid66\"},\"_:genid66\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#first\":\"http:\\/\\/www.w3.org\\/ns\\/prov#Entity\",\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#rest\":\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#nil\"},\"_:genid67\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"type\":\"string\",\"data\":\"Quotation is a particular case of derivation (see http:\\/\\/www.w3.org\\/TR\\/prov-dm\\/#term-quotation) in which an entity is derived from an original entity by copying, or \\\"quoting\\\", some or all of it. \"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasDerivedFrom\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasQuotedFrom\"},\"_:genid68\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Axiom\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"type\":\"string\",\"data\":\"Revision is a derivation (see http:\\/\\/www.w3.org\\/TR\\/prov-dm\\/#term-Revision). Moreover, according to \\nhttp:\\/\\/www.w3.org\\/TR\\/2013\\/REC-prov-constraints-20130430\\/#term-Revision 23 April 2012 \'wasRevisionOf is a strict sub-relation of wasDerivedFrom since two entities e2 and e1 may satisfy wasDerivedFrom(e2,e1) without being a variant of each other.\'\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedProperty\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedTarget\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasDerivedFrom\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#annotatedSource\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasRevisionOf\"}}}','{\"dependencies\":{\"rdf\":{\"url\":\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#\",\"occurrences\":243},\"owl\":{\"url\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#\",\"occurrences\":182},\"rdfs\":{\"url\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#\",\"occurrences\":445},\"prov\":{\"url\":\"http:\\/\\/www.w3.org\\/ns\\/prov#\",\"occurrences\":816},\"xsd\":{\"url\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#\",\"occurrences\":5}},\"status\":\"accept\"}','accept',1443548396,1443559496),('puuil','seshat','all',4,'frog',NULL,'{\"http:\\/\\/localhost\\/dacura\\/seshat\\/all\\/candidate\\/puuil\\/meta\":{\"status\":\"accept\"}}','accept',1439252602,1439264913),('Rome','seshat','all',4,'http://dacura.cs.tcd.ie/data/seshat#City',NULL,'{\"http:\\/\\/localhost\\/dacura\\/seshat\\/all\\/candidate\\/Rome\\/meta\":{\"status\":\"accept\"}}','accept',1438770951,1438833670),('rrrrrrrr','all','all',1,'ontology','{\"rrrrrrrr\":{\"http:\\/\\/www.w3.org\\/ns\\/oa#\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Ontology\",\"http:\\/\\/purl.org\\/dc\\/terms\\/modified\":{\"type\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTime\",\"data\":\"2013-02-22T21:40:51+01:00\"},\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#versionInfo\":{\"type\":\"string\",\"data\":\"0.9.20130208\"},\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/title\":{\"lang\":\"en\",\"data\":\"Open Annotation Data Model\"},\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/creator\":[{\"lang\":\"en\",\"data\":\"Robert Sanderson\"},{\"lang\":\"it\",\"data\":\"Paolo Ciccarese\"},{\"lang\":\"vls\",\"data\":\"Herbert Van de Sompel\"}],\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/contributor\":{\"lang\":\"en\",\"data\":\"Stian Soiland-Reyes\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The Open Annotation Core Data Model specifies an interoperable framework for creating associations between related resources, annotations, using a methodology that conforms to the Architecture of the World Wide Web.\\r\\n\\r\\nThis ontology is a non-normative OWL formalization of the textual OA specification at http:\\/\\/www.openannotation.org\\/spec\\/core\\/20130208\\/index.html\\r\\n\\r\\nNote that OWL imports are disabled in the published version in order to reduce external implications, improve OWL 2 Profile conformity and increase interoperability. Some OWL tools might thus misleadingly show this ontology as (re)defining properties like skos:prefLabel.\"},\"http:\\/\\/purl.org\\/dc\\/elements\\/1.1\\/description\":{\"lang\":\"en\",\"data\":\"The Open Annotation Core Data Model specifies an interoperable framework for creating associations between related resources, annotations, using a methodology that conforms to the Architecture of the World Wide Web. Open Annotations can easily be shared between platforms, with sufficient richness of expression to satisfy complex requirements while remaining simple enough to also allow for the most common use cases, such as attaching a piece of text to a single web resource.\\r\\n\\r\\nAn Annotation is considered to be a set of connected resources, typically including a body and target, where the body is somehow about the target. The full model supports additional functionality, enabling semantic annotations, embedding content, selecting segments of resources, choosing the appropriate representation of a resource and providing styling hints for consuming clients.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#seeAlso\":\"http:\\/\\/www.openannotation.org\\/spec\\/core\\/20130208\\/index.html\",\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#versionIRI\":\"http:\\/\\/www.openannotation.org\\/spec\\/core\\/20130208\\/oa.owl\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#annotatedBy\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"annotatedBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The object of the relationship is a resource that identifies the agent responsible for creating the Annotation. This may be either a human or software agent. \\r\\n\\r\\nThere SHOULD be exactly 1 oa:annotatedBy relationship per Annotation, but MAY be 0 or more than 1, as the Annotation may be anonymous, or multiple agents may have worked together on it.\\r\\n\\r\\nIt is RECOMMENDED to use these and other FOAF terms to describe agents: foaf:Person, prov:SoftwareAgent, foaf:Organization, foaf:name, foaf:mbox, foaf:openid, foaf:homepage\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasAttributedTo\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#cachedSource\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"cachedSource\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A link to a copy of the Source resource\'s representation appropriate for the Annotation, typically a copy of the original at the time that the Annotation was created\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#TimeState\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#default\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"default\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The constituent resource of a oa:Choice to use as a default option, if there is no other means to determine which would be most appropriate.\\r\\n\\r\\nThere SHOULD be exactly 1 default relationship for each Choice.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Choice\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#item\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#equivalentTo\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"equivalentTo\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The subject and object resources of the oa:equivalentTo relationship represent the same resource, but potentially have different metadata such as oa:serializedBy, oa:serializedAt and serialization format.  oa:equivalentTo is a symmetrical and transitive relationship; if A oa:equivalentTo B, then it is also true that B oa:equivalent A; and that if B oa:equivalentTo C, then it is also true that A oa:equivalentTo C. \\r\\n\\r\\nThe Annotation MAY include 0 or more instances of the oa:equivalentTo relationship between copies of the Annotation or other resources, and SHOULD include as many as are available.\\r\\n\\r\\nIf a system publishes an embedded resource (a cnt:Content) at a new HTTP URI, then it SHOULD express the oa:equivalentTo relationship between the resource\'s URN and the new URI from which it is available.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#alternateOf\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasBody\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasBody\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between oa:Annotation and body. The body is somehow \\\"about\\\" the oa:hasTarget of the annotation.\\r\\n\\r\\nThe Body may be of any media type, and contain any type of content. The Body SHOULD be identified by HTTP URIs unless they are embedded within the Annotation.\\r\\n\\r\\nEmbedded bodies SHOULD be instances of cnt:ContentAsText and embed their content with cnt:chars. They SHOULD declare their media type with dc:format, and MAY indicate their language using dc:language and a RFC-3066 language tag. \\r\\n\\r\\nThere is no OA class provided for \\\"Body\\\" as a body might be a target of a different annotation. However, there SHOULD be 1 or more content-based classes associated with the body resources of an Annotation, and the dctypes: vocabulary is recommended for this purpose, for instance dctypes:Text to declare textual content.\\r\\n\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasScope\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasScope\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a Specific Resource and the resource that provides the scope or context for it in this Annotation.\\r\\n\\r\\nThere MAY be 0 or more hasScope relationships for each Specific Resource.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasSelector\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:SpecificResource and a oa:Selector.\\r\\n\\r\\nThere MUST be exactly 0 or 1 oa:hasSelector relationship associated with a \\r\\nSpecific Resource. \\r\\n\\r\\nIf multiple Selectors are required, either to express a choice between different optional, equivalent selectors, or a chain of selectors that should all be processed, it is necessary to use oa:Choice, oa:Composite or oa:List as a selector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasSource\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasSource\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:SpecificResource and the resource that it is a more specific representation of. \\r\\n\\r\\nThere MUST be exactly 1 oa:hasSource relationship associated with a Specific Resource.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasState\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasState\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:SpecificResource and a oa:State resource.\\r\\n\\r\\nThere MAY be 0 or 1 oa:hasState relationship for each SpecificResource.\\r\\n\\r\\nIf there are multiple State resources that must be associated with the specific resource, then the use of the Multiplicity Constructs oa:Choice, oa:Composite or oa:List is RECOMMENDED.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#State\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#hasTarget\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"hasTarget\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between oa:Annotation and target. The target resource is what the oa:hasBody is somewhat \\\"about\\\".\\r\\n\\r\\nThe target may be of any media type, and contain any type of content. The target SHOULD be identified by HTTP URIs unless they are embedded within the Annotation.\\r\\n\\r\\nEmbedded targets SHOULD be instances of cnt:ContentAsText and embed their content with cnt:chars. They SHOULD declare their media type with dc:format, and MAY indicate their language using dc:language and a RFC-3066 language tag. \\r\\n\\r\\nThere is no OA class provided for \\\"Target\\\" as a target might be a body in a different annotation. However, there SHOULD be 1 or more content-based classes associated with the target resources of an Annotation, and the dctypes: vocabulary is recommended for this purpose, for instance dctypes:Text to declare textual content.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#item\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"item\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a multiplicity construct node and its constituent resources.\\r\\n\\r\\nThere MUST be 1 or more item relationships for each multiplicity construct oa:Choice, oa:Composite and oa:List.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#member\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#motivatedBy\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"motivatedBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between an Annotation and a Motivation, indicating the reasons why the Annotation was created.\\r\\n\\r\\nEach Annotation SHOULD have at least one oa:motivatedBy relationship, and MAY be more than 1.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#serializedBy\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"serializedBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The object of the relationship is the agent, likely software, responsible for generating the serialization of the Annotation\'s serialization. \\r\\n\\r\\nIt is RECOMMENDED to use these and other FOAF terms to describe agents: foaf:Person, prov:SoftwareAgent, foaf:Organization, foaf:name, foaf:mbox, foaf:openid, foaf:homepage\\r\\n\\r\\nThere MAY be 0 or more oa:serializedBy relationships per Annotation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subPropertyOf\":\"http:\\/\\/www.w3.org\\/ns\\/prov#wasAttributedTo\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#styledBy\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#ObjectProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"styledBy\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The relationship between a oa:Annotation and a oa:Style.\\r\\n\\r\\nThere MAY be 0 or 1 styledBy relationships for each Annotation.\\r\\n\\r\\nIf there are multiple Style resources that must be associated with the Annotation, then the use of the Multiplicity Constructs oa:Choice, oa:Composite or oa:List is RECOMMENDED.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Style\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#annotatedAt\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"annotatedAt\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The time at which the Annotation was created. \\r\\n\\r\\nThere SHOULD be exactly 1 oa:annotatedAt property per Annotation, and MUST NOT be more than 1. The datetime MUST be expressed in the xsd:dateTime format, and SHOULD have a timezone specified.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTimeStamp\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#end\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"end\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The end position of the segment of text or bytes. The first character\\/byte in the full text\\/stream is position 0. The character\\/byte indicated at position oa:end is NOT included within the selected segment. \\r\\n\\r\\nSee oa:DataPositionSelector and oa:oa:TextPositionSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#nonNegativeInteger\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#exact\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"exact\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A copy of the text which is being selected, after normalization.\\r\\n\\r\\nSee oa:TextQuoteSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#prefix\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"prefix\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A snippet of text that occurs immediately before the text which is being selected.\\r\\n\\r\\nSee oa:TextQuoteSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#serializedAt\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"serializedAt\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The time at which the agent referenced by oa:serializedBy generated the first serialization of the Annotation, and any subsequent substantially different one. The annotation graph MUST have changed for this property to be updated, and as such represents the last modified datestamp for the Annotation. This might be used to determine if it should be re-imported into a triplestore when discovered. \\r\\n\\r\\nThere MAY be exactly 1 oa:serializedAt property per Annotation, and MUST NOT be more than 1. The datetime MUST be expressed in the xsd:dateTime format, and SHOULD have a timezone specified.\\r\\n\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTimeStamp\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#start\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"start\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The starting position of the segment of text or bytes. The first character\\/byte in the full text\\/stream is position 0. The character\\/byte indicated at position oa:start is included within the selected segment. \\r\\n\\r\\nSee oa:DataPositionSelector and oa:TextPositionSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#nonNegativeInteger\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#styleClass\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"styleClass\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The string name of the class used in the CSS description that should be applied to the Specific Resource.\\r\\n\\r\\nThere MAY be 0 or more styleClass properties on a Specific Resource.\\r\\n\\r\\nSee oa:CssStyle.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#suffix\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"suffix\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The snippet of text that occurs immediately after the text which is being selected. \\r\\n\\r\\nSee oa:TextQuoteSelector.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#when\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#DatatypeProperty\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"when\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The timestamp at which the Source resource should be interpreted for the Annotation, typically the time that the Annotation was created.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#range\":\"http:\\/\\/www.w3.org\\/2001\\/XMLSchema#dateTimeStamp\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#domain\":\"http:\\/\\/www.w3.org\\/ns\\/oa#TimeState\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#Annotation\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Annotation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"Typically an Annotation has a single Body (oa:hasBody), which is the comment or other descriptive resource, and a single Target (oa:hasTarget) that the Body is somehow \\\"about\\\". The Body provides the information which is annotating the Target. \\r\\n\\r\\nThis \\\"aboutness\\\" may be further clarified or extended to notions such as classifying or identifying with oa:motivatedBy.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#Choice\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Choice\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#Alt\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A multiplicity construct that conveys to a consuming application that it should select one of the constituent resources to display to the user, and not render\\/use all of them. \\r\\n\\r\\noa:Choice can be used as the object of the object of the oa:hasBody, oa:hasTarget, oa:hasSelector, oa:hasState, oa:styledBy and oa:hasScope relationships, \\r\\n\\r\\nThere MUST be 1 or more oa:item relationships for each oa:Choice.\\r\\n\\r\\nThere SHOULD be exactly 1 default relationship for each Choice.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#Composite\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"type\":\"string\",\"data\":\"Composite\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#Bag\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A multiplicity construct that conveys to a consuming application that all of the constituent resources are required for the Annotation to be correctly interpreted. \\r\\n\\r\\noa:Composite can be used as the object of the object of the oa:hasBody, oa:hasTarget, oa:hasSelector, oa:hasState, oa:styledBy and oa:hasScope relationships, \\r\\n\\r\\nThere MUST be 2 or more oa:item relationships for each oa:Composite.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#CssStyle\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"CssStyle\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Style\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes styles for resources participating in the Annotation using CSS.\\r\\n\\r\\nSpecific Resources MAY be assigned a CSS style class using oa:styleClass.\\r\\n\\r\\nThe CSS resource MAY have its own dereferencable URI that provides the information. For example, \\\"Style1\\\" in the diagram below might actually have the URI \\\"http:\\/\\/www.example.com\\/styles\\/annotations.css\\\". It MAY be embedded within the Annotation using the inline constructions described in Embedding Resources.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#DataPositionSelector\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"DataPositionSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector which describes a range of data based on its start and end positions within the byte stream of the representation.\\r\\n\\r\\nEach DataPositionSelector MUST have exactly 1 oa:start property.\\r\\n\\r\\nEach TextPositionSelector MUST have exactly 1 oa:end property.\\r\\n\\r\\nSee oa:TextPositionSelector for selection at normalized character level rather than bytestream level.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#FragmentSelector\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"FragmentSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector which describes the segment of interest in a representation, through the use of the fragment identifier component of a URI.\\r\\n\\r\\nIt is RECOMMENDED to use oa:FragmentSelector as the selector on a Specific Resource rather than annotating the fragment URI directly, in order to improve discoverability of annotation on the Source.\\r\\n\\r\\nThe oa:FragmentSelector MUST have exactly 1 rdf:value property, containing the fragment identifier component of a URI that describes the segment of interest in the resource, excluding the initial \\\"#\\\".\\r\\n\\r\\nThe Fragment Selector SHOULD have a dcterms:conformsTo relationship with the object being the specification that defines the syntax of the fragment, for instance <http:\\/\\/tools.ietf.org\\/rfc\\/rfc3236> for HTML fragments. \"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#HttpRequestState\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"HttpRequestState\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#State\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes how to retrieve an appropriate representation of the Source resource for the Annotation, based on the HTTP Request headers to send to the server.\\r\\n\\r\\nThere MUST be exactly 1 rdf:value property per HttpRequestState, containing HTTP request headers as a single, complete string, exactly as they would appear in an HTTP request. \"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#List\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"List\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Composite\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A multiplicity construct that conveys to a consuming application that all of the constituent resources are required for the Annotation to be correctly interpreted, and in a particular order. \\r\\n\\r\\noa:List can be used as the object of the object of the oa:hasBody, oa:hasTarget, oa:hasSelector, oa:hasState, oa:styledBy and oa:hasScope relationships, \\r\\n\\r\\nThere MUST be 2 or more oa:item relationships for each oa:List, with their order defined using the rdf:List construct of rdf:first\\/rdf:rest\\/rdf:nil.\\r\\n\\r\\nAll the elements of the list should also be declared using oa:item, and each of the oa:items should appear at least once in the list.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Motivation\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#Concept\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The Motivation for creating an Annotation, indicated with oa:motivatedBy, is a reason for its creation, and might include things like oa:replying to another annotation, oa:commenting on a resource, or oa:linking to a related resource.\\r\\n\\r\\nEach Annotation SHOULD have at least one oa:motivatedBy relationship to an instance of oa:Motivation, which is a subClass of skos:Concept.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Selector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes the segment of interest in a representation of a Source resource, indicated with oa:hasSelector from the Specific Resource. \\r\\n\\r\\nThis class is not used directly in Annotations, only its subclasses are.\\r\\n\\r\\nThe nature of the Selector will be dependent on the type of the representation for which the segment is conveyed. The specific type of selector should be indicated using a subclass of oa:Selector.\\r\\n\\r\\nThe Specifier\'s description MAY be conveyed as an external or embedded resource (cnt:Content), or as RDF properties within the graph. The description SHOULD use existing standards whenever possible. If the Specifier has an HTTP URI, then its description, and only its description, MUST be returned when the URI is dereferenced.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#SemanticTag\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"SemanticTag\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Tag\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A class assigned to the Body when it is a semantic tagging resource; a URI that identifies a concept, rather than an embedded string, frequently a term from a controlled vocabulary.\\r\\n\\r\\nIt is NOT RECOMMENDED to use the URI of a document as a Semantic Tag, as it might also be used as a regular Body in other Annotations which would inherit the oa:SemanticTag class assignment. Instead it is more appropriate to create a new URI and link it to the document, using the foaf:page predicate.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#SpecificResource\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"SpecificResource\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource identifies part of another Source resource, a particular representation of a resource, a resource with styling hints for renders, or any combination of these. \\r\\n\\r\\nThe Specific Resource takes the role of oa:hasBody or oa:hasTarget in an oa:Annotation instead of the Source resource.\\r\\n\\r\\nThere MUST be exactly 1 oa:hasSource relationship associated with a Specific Resource.\\r\\n\\r\\nThere MUST be exactly 0 or 1 oa:hasSelector relationship associated with a Specific Resource.\\r\\n\\r\\nThere MAY be 0 or 1 oa:hasState relationship for each Specific Resource.\\r\\n\\r\\nIf the Specific Resource has an HTTP URI, then the exact segment of the Source resource that it identifies, and only the segment, MUST be returned when the URI is dereferenced. For example, if the segment of interest is a region of an image and the Specific Resource has an HTTP URI, then dereferencing it MUST return the selected region of the image as it was at the time when the annotation was created. Typically this would be a burden to support, and thus the Specific Resource SHOULD be identified by a globally unique URI, such as a UUID URN. If it is not considered important to allow other Annotations or systems to refer to the Specific Resource, then a blank node MAY be used instead.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#State\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"State\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes how to retrieve an appropriate representation of the Source resource, indicated with oa:hasState from the Specific Resource.\\r\\n\\r\\nThis class is not used directly in Annotations, only its subclasses are.\\r\\n\\r\\nThe Specifier\'s description MAY be conveyed as an external or embedded resource (cnt:Content), or as RDF properties within the graph. The description SHOULD use existing standards whenever possible. If the Specifier has an HTTP URI, then its description, and only its description, MUST be returned when the URI is dereferenced.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#Style\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Style\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes the style in which the selection or resource should be rendered, indicated with oa:styledBy from an oa:Annotation.\\r\\n\\r\\nThis class is not used directly in Annotations, only its subclasses are.\\r\\n\\r\\nThe content of the resource provides the rendering hints about the Annotation\'s constituent resources. \\r\\n\\r\\nThe Specifier\'s description MAY be conveyed as an external or embedded resource (cnt:Content), or as RDF properties within the graph. The description SHOULD use existing standards whenever possible. If the Specifier has an HTTP URI, then its description, and only its description, MUST be returned when the URI is dereferenced.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#SvgSelector\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"SvgSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector which selects an area specified as an SVG shape.\\r\\n\\r\\nThe SVG document should either be retrievable by resolving the URI of this resource, or be included as an Embedded Resource using cnt:Content.\\r\\n\\r\\nIt is RECOMMENDED that the document contain only a single shape element and that element SHOULD be one of: path, rect, circle, ellipse, polyline, polygon or g. The g element SHOULD ONLY be used to construct a multi-element group, for example to define a donut shape requiring an outer circle and a clipped inner circle.\\r\\n\\r\\nThe dimensions of both the shape and the SVG canvas MUST be relative to the dimensions of the Source resource. For example, given an image which is 600 pixels by 400 pixels, and the desired section is a circle of 100 pixel radius at the center of the image, then the SVG element would be: <circle cx=\\\"300\\\" cy=\\\"200\\\" r=\\\"100\\\"\\/>\\r\\n\\r\\nIt is NOT RECOMMENDED to include style information within the SVG element, nor Javascript, animation, text or other non shape oriented information. Clients SHOULD ignore such information if present.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#Tag\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"Tag\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A class assigned to the Body when it is a tag, such as a embedded text string with cnt:chars.\\r\\n\\r\\nTags are typically keywords or labels, and used for organization, description or discovery of the resource being tagged. In the Semantic Web, URIs are used instead of strings to avoid the issue of polysemy where one word has multiple meanings, such usage MUST be indicated using the subclass oa:SemanticTag.\\r\\n\\r\\nAnnotations that tag resources, either with text or semantic tags, SHOULD also have the oa:tagging motivation to make the reason for the Annotation more clear to applications, and MAY have other motivations as well.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#TextPositionSelector\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"TextPositionSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"An oa:Selector which describes a range of text based on its start and end positions.\\r\\n\\r\\nThe text MUST be normalized before counting characters. For a Selector that works from the bitstream rather than the rendered characters, see oa:DataPositionSelector.\\r\\n\\r\\nEach oa:TextPositionSelector MUST have exactly 1 oa:start property.\\r\\n\\r\\nEach oa:TextPositionSelector MUST have exactly 1 oa:end property.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#TextQuoteSelector\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"TextQuoteSelector\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#Selector\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A Selector that describes a textual segment by means of quoting it, plus passages before or after it.\\r\\n\\r\\nFor example, if the document were \\\"abcdefghijklmnopqrstuvwxyz\\\", one could select \\\"efg\\\" by a oa:prefix of \\\"abcd\\\", the quotation of oa:exact \\\"efg\\\" and a oa:suffix of \\\"hijk\\\".\\r\\n\\r\\nThe text MUST be normalized before recording.\\r\\n\\r\\nEach TextQuoteSelector MUST have exactly 1 oa:exact property.\\r\\n\\r\\nEach TextQuoteSelector SHOULD have exactly 1 oa:prefix property, and MUST NOT have more than 1.\\r\\n\\r\\nEach TextQuoteSelector SHOULD have exactly 1 oa:suffix property, and MUST NOT have more than 1.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#TimeState\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#Class\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"TimeState\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#subClassOf\":\"http:\\/\\/www.w3.org\\/ns\\/oa#State\",\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"A resource which describes how to retrieve a representation of the Source resource that is temporally appropriate for the Annotation.\\r\\n\\r\\nThere MUST be at least one of oa:cachedSource or oa:when specified. If there is more than 1, each gives an alternative copy of the representation.\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#isDefinedBy\":\"http:\\/\\/www.w3.org\\/ns\\/oa#\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#bookmarking\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents the creation of a bookmark to the target resources or recorded point or points within one or more resources. For example, an Annotation that bookmarks the point in a text where the reader finished reading. Bookmark Annotations may or may not have a Body resource.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"bookmarking\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#classifying\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents the assignment of a classification type, typically from a controlled vocabulary, to the target resource(s). For example to classify an Image resource as a Portrait.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"classifying\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#commenting\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a commentary about or review of the target resource(s). For example to provide a commentary about a particular PDF.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"commenting\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#describing\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a description of the target resource(s), as opposed to a comment about them. For example describing the above PDF\'s contents, rather than commenting on their accuracy.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"describing\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#editing\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a request for a modification or edit to the target resource. For example, an Annotation that requests a typo to be corrected.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"editing\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#highlighting\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents a highlighted section of the target resource or segment. For example to draw attention to the selected text that the annotator disagrees with. A Highlight may or may not have a Body resource\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"highlighting\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#identifying\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents the assignment of an identity to the target resource(s). For example, annotating the name of a city in a string of text with the URI that identifies it.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"identifying\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#linking\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents an untyped link to a resource related to the target.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"linking\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#moderating\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents an assignment of value or quality to the target resource(s). For example annotating an Annotation to moderate it up in a trust network or threaded discussion.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"moderating\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#ConceptScheme\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#label\":{\"lang\":\"en\",\"data\":\"motivationScheme\"},\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The concept scheme for Open Annotation Motivations\"}},\"http:\\/\\/www.w3.org\\/ns\\/oa#questioning\":{\"http:\\/\\/www.w3.org\\/1999\\/02\\/22-rdf-syntax-ns#type\":[\"http:\\/\\/www.w3.org\\/2002\\/07\\/owl#NamedIndividual\",\"http:\\/\\/www.w3.org\\/ns\\/oa#Motivation\"],\"http:\\/\\/www.w3.org\\/2000\\/01\\/rdf-schema#comment\":{\"lang\":\"en\",\"data\":\"The motivation that represents asking a question about the target resource(s). For example to ask for assistance with a particular section of text, or question its veracity.\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#prefLabel\":{\"lang\":\"en\",\"data\":\"questioning\"},\"http:\\/\\/www.w3.org\\/2004\\/02\\/skos\\/core#inScheme\":\"http:\\/\\/www.w3.org\\/ns\\/oa#motivationScheme\"},\"http:\\/\\/www.w3.org\\/ns\\/oa#replying\":{\"http:\\/\\/www.w3.org\